import React from "react";
import usePlacesAutocomplete, {
  getGeocode,
  getLatLlng
} from "use-places-autocomplete";

function Search(props) {
  const {
    ready, 
    value, 
    suggestions: {status, data}, 
    setValue, 
    clearSuggestions
  } = usePlacesAutocomplete({
    requestOptions: {
      location: {
        lat: () => 41.878113,
        lng: () => -87.629799,
      },
      radius: 200 * 1000
    }
  });
  return (null);
}

export default Search
